import React from 'react';
import { motion } from 'framer-motion';
import EarthImage from '../images/earth.png';

const AroundTheWorld = () => {
  return (
    <motion.div className="curved-animation-container">
      <img src={EarthImage} alt="Earth" className="earth-image" />
      <motion.div className="curved-text-container">
        <motion.p
          className="curved-text"
          animate={{ rotate: 360 }}
          transition={{ duration: 5, repeat: Infinity, ease: 'linear' }}
        >
          Your Curved Text Goes Here
        </motion.p>
      </motion.div>
    </motion.div>
  );
};

export default AroundTheWorld;
